:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK, Henry Samuel (Harry) and KINSELLA, Hana
  JLUDBROOK, Kenneth William and BANKS, Barbara Susan (Tosti)
  JLUDBROOK, Sally June and COVENTRY, Richard Donald
  04> COVENTRY, Jamie Donald
  b 29.06.1973
  Jamie was educated at Hamilton Boys' High School where he was deputy head boy. He played for the
  1st rugby XV and the Waikato Under 16 team. He is currently a student at Waikato University.
  04> LUDBROOK, Kenneth James m on 29.08.1979 to YOUNG, Julie Anne
  b 06.09.1944
  b 17.01.1944
  James b, at Taiamai and m. at Auckland. Julie, d/o Clarence John Seccombe and Meryl Gwendoline Choat.
  Julie has three children from a previous marriage, Gregory James Young (b. 13.10.1966), Dallas Graham
  Young (b. 08.04.1968) and Natalie Jane Young (b. 07.08.1970). Address: Devonport Village Inn, 9 Albert
  Road, Devonport, Auckland.
  James was educated at Cambridge High School and was a member of the Hamilton Operatic Society during
  the 1970's and 80's. He is well-known for some outstanding lead performances in recent years. James is
  a restaurateur currently operating a bed and breakfast business in Devonport called the Devonport
  Village Inn.
  01> LUDBROOK, Alexandra Julie
  b 06.09.1980
  Alexandra has completed a year at a performing arts school and is pursuing a career as a singer.
  05> LUDBROOK, William Banks (Bill) m on 06.11.1971 to CAIRNS, Stephanie
  b 13.08.1946
  b 22.10.1947
  William b. at Taiamai and m. at St Aidan's Church, Remuera, Auckland. Stephanie, dlo
  Gilbert Eastcott Cairns and Nancye Philippa Cairns, b. at Auckland. Address: 2 Fenton
  Crescent, Orakei, Auckland.
  Bill was a farm cadet at Flockhouse station, Bulls in 1963 then returned to Ohaeawai in
  1964 to manage his father's K W Ludbrook Estate "Taiamai" block with his mother until
  the farm was sold in 1972. He and Stephanie then moved to Paihia and purchased the
  property adjacent to the Henry Williams Memorial Church where they established a tourist amenity
  specialising in accommodation and Devon teas.
  Bill was a representative of Bay of Islands and Northland at rugby and, as a 19 year old, was a member
  of the North Auckland rugby team which was narrowly defeated by the touring British Lions in 1966. His
  other interests include tennis and cricket and the New Zealand thoroughbred breeding industry. Bill has
  been an investment broker in Auckland since 1985.
  Stephanie was educated at Woodford House, Havelock North. She is a registered nurse and is charge
  nurse at the Epsom Chelation Therapy Clinic in Auckland.
  01> LUDBROOK, Erica Stephanie
  b 22.02.1974
  Erica b. at Paihia. She was educated at Diocesan School for Girls. She has embarked on an
  international travel sojourn, her first assignment being as a nanny to the two young children of a
  count and countess in Venice, Italy.
  02> LUDBROOK, Louise Rachel
  b 26.04.1976
  Louise b, at Paihia. She was educated at Diocesan School for Girls at Epsom, Auckland, From an
  early age Louise has been interested in the performing arts and she has studied acting and singing
  at the Performing Arts School in Auckland. She is spending time in Italy before beginning her
  career in the international tourism/entertainment industry.
